import { useCallback, useEffect, useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import { onAuthStateChanged, signOut } from "firebase/auth"; // Import Firebase auth listener
import { auth } from "./firebase"; // Import your Firebase auth configuration
import { useSpring, animated } from "@react-spring/web";
import "./AllAssessments.css";

const AllAssessments = () => {
  const navigate = useNavigate();
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [message, setMessage] = useState(""); // Message to show confirmation

  const handleLogout = () => {
    signOut(auth).then(() => setIsLoggedIn(false));
  };

  const navigateTo = useCallback((path) => {
    navigate(path);
  }, [navigate]);

  const newTab = (url) => {
    window.open(url);
  };

  // Animation for fading in content
  const fadeProps = useSpring({
    opacity: 1,
    transform: "translateY(0px)",
    from: { opacity: 0, transform: "translateY(50px)" },
    config: { duration: 800 },
  });

  // Typing Animation States and Logic
  const [isTyping, setIsTyping] = useState(false);
  const [typedText, setTypedText] = useState("");
  const footerRef = useRef(null);

  const fullText =
    "ADHDR: integrating gamification and dynamic questionnaires to simplify the diagnosis process";

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setIsTyping(true);
        }
      },
      { threshold: 0.5 } // Detects when 50% of the element is visible
    );
    if (footerRef.current) {
      observer.observe(footerRef.current);
    }
    return () => observer.disconnect();
  }, []);

  useEffect(() => {
    if (!isTyping) return;

    let index = 0;
    setTypedText(""); // Reset text when animation starts
    const typingInterval = setInterval(() => {
      if (index < fullText.length) {
        setTypedText((prev) => prev + fullText.charAt(index));
        index++;
      } else {
        clearInterval(typingInterval);
      }
    }, 100); // Adjust speed of typing here (100ms per character)

    return () => clearInterval(typingInterval);
  }, [isTyping]);

  return (
    <div className="contact-us-page">
      <div className="home">
        {/* Header Section */}
        <div className="header">
          <div className="adhdr-container">
            <div className="nav-item" onClick={() => navigateTo("/")}>ADHDR</div>
          </div>
          <div className="about-container">
            <div className="nav-item" onClick={() => navigateTo("/about-us")}>
              About Us
            </div>
          </div>
          <div className="results-container">
            <div className="nav-item" onClick={() => navigateTo("/your-results")}>
              Your Results
            </div>
          </div>
          <div className="resources-container">
            <div className="nav-item" onClick={() => navigateTo("/adhd-resources")}>
              ADHD Resources
            </div>
          </div>
          <div className="contact-container">
            <div className="nav-item" onClick={() => navigateTo("/contact")}>
              Contact Us
            </div>
          </div>
          <div className="contact-container">
            {isLoggedIn ? (
              <div className="nav-item" onClick={handleLogout}>Log Out</div>
            ) : (
              <div className="nav-item" onClick={() => navigateTo("/login")}>
                Login or Sign Up
              </div>
            )}
          </div>
        </div>

        {/* Main Content Section */}
        <animated.div style={fadeProps} className="content-wrapper">
          <div className="about-title">
            <h1>Take our Assessments!</h1>
            <p className="tagline">Click on our original, interactive, and dynamic assessments!</p>
          </div>

          <div className="content-sections">
            {/* Section Card with Berry Blitz */}
            <div className="section-wrapper">
              <div className="section-card berry-blitz-card">
                <div className="image-container">
                  <img
                    className="berry-blitz-button"
                    alt="Berry Blitz"
                    src="/image-1@2x.png"
                    onClick={() => newTab("http://berryblitz.neurohealthalliance.org")}
                    style={{ cursor: "pointer" }}
                  />
                  <div className="overlay">
                    <p className="overlay-text" onClick={() => newTab("http://berryblitz.neurohealthalliance.org")}>
                      Can you collect all of the fruits while avoiding the shurikens? This energetic,
                      intense game will test your reflexes and ability to process information quickly.
                    </p>
                  </div>
                </div>
              </div>
              <h2 className="game-title">Berry Blitz</h2>
            </div>
          </div>
        </animated.div>

        {/* Footer Section */}
        <div className="navigation-footer1" ref={footerRef}>
          <div className="adhdr3">
            <p className="adhdr4">
              {typedText}
              {typedText.length < fullText.length && <span className="ellipsis">...</span>}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AllAssessments;
